  - System.Diagnostics.TraceSource
  namespace: System.Diagnostics
  summary: "\n<p>Provides the default output methods and behavior for tracing.</p>\n"
  remarks: "\n<p>An instance of this class is automatically added to the <xref href=\"System.Diagnostics.Debug.Listeners\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"System.Diagnostics.Trace.Listeners\" data-throw-if-not-resolved=\"false\"></xref> collections. Explicitly adding a second <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref> causes duplicate messages in the debugger output window and duplicate message boxes for asserts.</p>\n<p>By default, the <xref href=\"System.Diagnostics.DefaultTraceListener.Write(System.String)\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"System.Diagnostics.DefaultTraceListener.WriteLine(System.String)\" data-throw-if-not-resolved=\"false\"></xref> methods emit the message to the Win32 <strong>OutputDebugString</strong> function and to the <xref href=\"System.Diagnostics.Debugger.Log(System.Int32,System.String,System.String)\" data-throw-if-not-resolved=\"false\"></xref> method. For information about the <strong>OutputDebugString</strong> function, see the Platform SDK or MSDN.</p>\n<p>The <xref href=\"System.Diagnostics.DefaultTraceListener.Fail(System.String)\" data-throw-if-not-resolved=\"false\"></xref> method, by default, displays a message box when the application is running in a user interface mode; it also emits the message using <xref href=\"System.Diagnostics.DefaultTraceListener.WriteLine(System.String)\" data-throw-if-not-resolved=\"false\"></xref>.</p>\n<p>The display of the message box for <see cref=\"Overload:System.Diagnostics.Debug.Assert\"></see> and <see cref=\"Overload:System.Diagnostics.Debug.Fail\"></see> method calls depends on the presence of the <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref>. If the <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref> is not in the <xref href=\"System.Diagnostics.Trace.Listeners\" data-throw-if-not-resolved=\"false\"></xref> collection, the message box is not displayed. The <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref> can be removed by the <clear> element, by the <remove> element, or by calling the <xref href=\"System.Diagnostics.TraceListenerCollection.Clear\" data-throw-if-not-resolved=\"false\"></xref> method on the <xref href=\"System.Diagnostics.Trace.Listeners\" data-throw-if-not-resolved=\"false\"></xref> property (<code>System.Diagnostics.Trace.Listeners.Clear()</code>).</p>\n<p>You must enable tracing or debugging to use a trace listener. The following syntax is compiler specific. If you use compilers other than C# or Visual Basic, refer to the documentation for your compiler.</p>\n<ul><li>\n<p>To enable debugging in C#, add the <strong>/d:DEBUG</strong> flag to the compiler command line when you compile your code, or add <strong>#define DEBUG</strong> to the top of your file. In Visual Basic, add the <strong>/d:DEBUG=True</strong> flag to the compiler command line.</p>\n</li><li>\n<p>To enable tracing in C#, add the <strong>/d:TRACE</strong> flag to the compiler command line when you compile your code, or add <strong>#define TRACE</strong> to the top of your file. In Visual Basic, add the <strong>/d:TRACE=True</strong> flag to the compiler command line.</p>\n</li></ul>\n<p>To add a trace listener, edit the configuration file that corresponds to the name of your application. Within this file, you can add a listener, set its type and set its parameters, remove a listener, or clear all the listeners previously set by the application. The configuration file should be formatted similar to the following example: </p>\n<pre><code><configuration>\n<system.diagnostics>\n<trace autoflush=\"false\" indentsize=\"4\">\n<listeners>\n<remove name=\"Default\" />\n<add name=\"myListener\"  type=\"System.Diagnostics.TextWriterTraceListener\"    initializeData=\"c:\\myListener.log\" />\n</listeners>\n</trace>\n</system.diagnostics>\n</configuration></code></pre>\n"
  example:
  - "\n<p>The following code example calculates binomial coefficients, which are values used in probability and statistics. This example uses a <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref> to trace results and log errors. It creates a new <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref>, adds it to the <xref href=\"System.Diagnostics.Trace.Listeners\" data-throw-if-not-resolved=\"false\"></xref> collection, and sets the <xref href=\"System.Diagnostics.DefaultTraceListener.LogFileName\" data-throw-if-not-resolved=\"false\"></xref> property to the log file specified in the command-line arguments.</p>\n<p>If an error is detected while processing the input parameter, or if the <code>CalcBinomial</code> function throws an exception, the <see cref=\"Overload:System.Diagnostics.DefaultTraceListener.Fail\"></see> method logs and displays an error message. If the <xref href=\"System.Diagnostics.DefaultTraceListener.AssertUiEnabled\" data-throw-if-not-resolved=\"false\"></xref> property is <strong>false</strong>, the error message is also written to the console. When the result is calculated successfully, the <xref href=\"System.Diagnostics.DefaultTraceListener.Write(System.String)\" data-throw-if-not-resolved=\"false\"></xref> and <xref href=\"System.Diagnostics.DefaultTraceListener.WriteLine(System.String)\" data-throw-if-not-resolved=\"false\"></xref> methods write the results to the log file.</p>\n<p>The <see cref=\"Overload:System.Diagnostics.DefaultTraceListener.Fail\"></see>, <see cref=\"Overload:System.Diagnostics.DefaultTraceListener.Write\"></see>, and <see cref=\"Overload:System.Diagnostics.DefaultTraceListener.WriteLine\"></see> methods cause trace information to be written only to the <xref href=\"System.Diagnostics.DefaultTraceListener\" data-throw-if-not-resolved=\"false\"></xref>. To write trace information to all listeners in the <xref href=\"System.Diagnostics.Trace.Listeners\" data-throw-if-not-resolved=\"false\"></xref> collection, use the <see cref=\"Overload:System.Diagnostics.Trace.Fail\"></see>, <see cref=\"Overload:System.Diagnostics.Trace.Write\"></see>, and <see cref=\"Overload:System.Diagnostics.Trace.WriteLine\"></see> methods of the <xref href=\"System.Diagnostics.Trace\" data-throw-if-not-resolved=\"false\"></xref> class.</p>System.Diagnostics.DefaultTraceListener#11"
